const NumberList = ({pageQuantity}) =>{
const array = []
    for (let i = 0; i < pageQuantity.length; i++) {
    
    array.push(i)
}
return(
    <ul>
        {array.map((num)=>{
            return(

                <li>{num}</li>
            )
        })}
    </ul>

)




}
export default NumberList
